	function i_write_file($filename,$data="") {
		$f = @fopen($filename,"w");
		if(!$f) return false;
		@fwrite($f,$data);
		@fclose($f);
		return true;
	}
	function i_read_file($filename) {
		$f = @fopen($filename,"r");
		if(!$f) return false;
		$data = @fread($f,filesize($filename));
		@fclose($f);
		return $data;
	}
	function empty_folder($dir) {
		if ($handle = @opendir($dir)) {
			while (false !== ($file = @readdir($handle))) { 
				if ($file != "." && $file != "..") 
					if(!@is_dir("$dir/$file"))
						@unlink("$dir/$file");
			}
			@closedir($handle); 
		}
	}

	function create_folders_from_array($arr,$spath='.',$filename='index.html',$data='') {
		if(!is_array($arr)) return true;
		foreach($arr as $k=> $v) {
			$ftoc='';
			if(is_array($v)) {
				@mkdir("$spath/$k");
				create_folders_from_array($v,"$spath/$k",$filename,$data);
				$ftoc = $k;
			} else {
				@mkdir("$spath/$v");
				$ftoc = $v;
			}
				
			if($filename!='') i_write_file("$spath/$ftoc/$filename",$data);
		}
		return true;
	}	
